INSERT INTO `object_query_9` VALUES (164,9,'products','SmartMed Premier',46,146,'object','Anda pasti pernah merasakan pentingnya kesiapan dana apabila harus dirawat di rumah sakit dalam atau luar negeri, dan harus melakukan perawatan khusus. Allianz menghadirkan program ini untuk mengatasi masalah Anda. '),(166,9,'products','SmartLink New Flexi Account Plus',49,148,'object',NULL),(167,9,'products','SmartHealth Maxi Violet',50,146,'object','Asuransi kesehatan yang memberikan manfaat tepat bagi Anda dan keluarga (bila diikutsertakan), karena memberi penggantian biaya rawat inap sekaligus santunan kematian apabila seseorang menderita penyakit atau kecelakaan. '),(168,9,'products','SmartLink Flexi Account',51,148,'object','Asuransi jiwa yang sekaligus memberikan kesempatan keuntungan investasi. Tersedia manfaat tambahan yang dapat dipilih sesuai kebutuhan serta peluang memasuki pasar yang mungkin tidak dapat Anda masuki sebagai investor tunggal. '),(169,9,'products','Asuransi Allianz MobilKu',52,149,'object','Allianz MobilKu dirancang khusus untuk memberikan perlindungan yang terbaik bagi Anda dan mobil Anda. Tidak perlu khawatir bila mobil Anda berhenti di tengah jalan. Allianz MobilKu mempunyai jaringan bengkel rekanan yang luas. '),(170,9,'products','Asuransi Perjalanan TravelPro',53,149,'object','Tersedia paket TravelPro Premium, TravelPro Deluxe dan TravelPro Superior dengan jangkauan ASEAN Plus dan Worldwide dan durasi perjalanan dari 4 - 30 hari dan berlaku premi khusus untuk tambahan durasi perjalanan. Paket Family: 2 orang dewasa, atau 1 orang dewasa dan anak-anaknya, atau 2 orang dewasa dan anak-anak dari paling tidak salah satu dari mereka Anak-anak: usia dibawah 18 tahun Pertanggungan meliputi: Medical cover Medical expense overseas Overseas hospital daily cash benefits Worldwide emergency assistance Emergency evacuation Repatriation Return of unattended children Hospital admission guarantee Add. Cost due to hospitalization for 1 accompanying family member 24-h emergency assistance hotline ');
