INSERT INTO `object_store_9` VALUES (164,'SmartMed Premier',46,'<p>Anda pasti pernah merasakan pentingnya kesiapan dana apabila harus dirawat di rumah sakit dalam atau luar negeri, dan harus melakukan perawatan khusus. Allianz menghadirkan program ini untuk mengatasi masalah Anda.</p>\n'),(166,'SmartLink New Flexi Account Plus',49,NULL),(167,'SmartHealth Maxi Violet',50,'<p class=\"des\">Asuransi kesehatan yang memberikan manfaat tepat bagi Anda dan keluarga (bila diikutsertakan), karena memberi penggantian biaya rawat inap sekaligus santunan kematian apabila seseorang menderita penyakit atau kecelakaan.</p>\n'),(168,'SmartLink Flexi Account',51,'<p>Asuransi jiwa yang sekaligus memberikan kesempatan keuntungan investasi. Tersedia manfaat tambahan yang dapat dipilih sesuai kebutuhan serta peluang memasuki pasar yang mungkin tidak dapat Anda masuki sebagai investor tunggal.</p>\n'),(169,'Asuransi Allianz MobilKu',52,'<p>Allianz MobilKu dirancang khusus untuk memberikan perlindungan yang terbaik bagi Anda dan mobil Anda. Tidak perlu khawatir bila mobil Anda berhenti di tengah jalan. Allianz MobilKu mempunyai jaringan bengkel rekanan yang luas.</p>\n'),(170,'Asuransi Perjalanan TravelPro',53,'<p>Tersedia paket TravelPro Premium, TravelPro Deluxe dan TravelPro Superior dengan jangkauan ASEAN Plus dan Worldwide dan durasi perjalanan dari 4 - 30 hari dan berlaku premi khusus untuk tambahan durasi perjalanan.</p>\n\n<p>Paket Family:</p>\n\n<ul>\n	<li>2 orang dewasa, atau</li>\n	<li>1 orang dewasa dan anak-anaknya, atau</li>\n	<li>2 orang dewasa dan anak-anak dari paling tidak salah satu dari mereka Anak-anak: usia dibawah 18 tahun</li>\n</ul>\n\n<p>Pertanggungan meliputi:</p>\n\n<ul>\n	<li>Medical cover\n	<ul>\n		<li>Medical expense overseas</li>\n		<li>Overseas hospital daily cash benefits</li>\n	</ul>\n	</li>\n	<li>Worldwide emergency assistance\n	<ul>\n		<li>Emergency evacuation</li>\n		<li>Repatriation</li>\n		<li>Return of unattended children</li>\n		<li>Hospital admission guarantee</li>\n		<li>Add. Cost due to hospitalization for 1 accompanying family member</li>\n		<li>24-h emergency assistance hotline</li>\n	</ul>\n	</li>\n</ul>\n');
